import React from 'react';
import logo from '../images/logo.png';

const Logo = () => {
  return (
    <div className="header-logo-container">
      <img src={logo} alt="logo" className="header-logo-image" style={{ width: '100%' }} />
    </div>
  );
};

export default Logo;
